import { ADD_EVENT, DELETE_EVENT } from '../types';

const musicEventReducer = (state, action) => {
    let musicEvents = [
        {
            name: 'Lollapalooza',
            cost: 400,
            artists: [],
        },
        {
            name: 'EDC',
            cost: 200,
            artists: [],
        },
        {
            name: 'HARD Summer',
            cost: 100,
            artists: [],
        },
    ];
    return musicEvents;
};

export default musicEventReducer;
